import React, { Component } from "react";

class Videos extends Component {
  render() {
    return (
      <React.Fragment>
        <div className="arrows">
          <a href="#" onClick={this.props.slideright} class="previous round">
            &#8249;
          </a>
          <a href="#" onClick={this.props.slideleft} class="next round">
            &#8250;
          </a>
        </div>
        <div
          className="body_videos_all"
          style={{ marginLeft: String(this.props.leftMargin) + "px" }}
        >
          {this.props.imgurls.map((url) => (
            <div>
              <img className="body_videos" src={url}></img>
            </div>
          ))}
        </div>
      </React.Fragment>
    );
  }
}

export default Videos;
